import React from "react";
import { Div0,Logo,HeaderList,LogoText } from "./style";
const BesideInner = () => {
    return(
        <Div0>
                <Logo>
                    <img src='https://i.imgur.com/BJ21wvu.png'  height={56} width={87.5}></img>
                </Logo>
                <HeaderList>
                    <LogoText>
                        管理系統
                    </LogoText>
                </HeaderList>
        </Div0>
    )
}
export default BesideInner;
